INSERT INTO `sbc-setting`.`cross_base_config`(`base_id`, `register_code`, `register_name`, `company_code`, `company_name`, `payment_name`, `payment_account`, `social_credit_code`, `reduction_rate`, `taxation_desc`, `policy_desc`, `mobile_desc`, `pc_desc`, `base_logo`, `identity_check`, `free_reight`, `base_freight`, `create_time`, `create_person`, `update_time`, `update_person`, `delete_time`, `delete_person`, `del_flag`) VALUES ('2c9384996aba1b1b016abaac19d10000', '4398280001', 'SKT T1', '1234567890', '万米电商（千米，O(∩_∩)O哈哈~）', '万米电商（千米，O(∩_∩)O哈哈~）', '213123312312', '321312312312312312', 70.00, '<p>根据跨境电子商务零售进口税收政策，个人单笔交易限值人民币5000元，个人年度交易限值人民币26000元。在限值以内进口的跨境电子商务零售进口商品，关税税率暂设为0%；进口环节增值税、消费税按法定应纳税额的70%征收。计算规则如下：</p><p><br/></p><p>税费=购买单价 x 件数 x 跨境电商综合税率</p><p><br/></p><p>支付金额=购买单价*数量+税费</p><p><br/></p><p>跨境电商综合税率 =[（消费税率 + 增值税率）/（1-消费税率）]×70%</p><p><br/></p><p>注：优惠券仅可抵扣商品金额，运费需缴纳税费。税费为海囤全球代征代缴，如因个人原因退货，税费将不予返还。</p><p><img src=\"https://wanmi-b2b.oss-cn-shanghai.aliyuncs.com/201906131522196785.png\" title=\"\" alt=\"undefined/\"/></p>', '<p>依据《关于跨境电子商务零售进口税收政策的通知》，跨境电子商务零售进口商品的单次交易限值为人民币5000元，个人年度交易限值为人民币26000元。</p><p><br/></p><p>跨境电子商务年度个人额度官方查询链接：http://ceb2pub.chinaport.gov.cn/limit/outIndex</p><p><br/></p><p>在限值以内进口的跨境电子商务零售进口商品，关税税率暂设为0%；进口环节增值税、消费税取消免征税额，暂按法定应纳税额的70%征收。</p><p><br/></p><p>超过单次限值、累加后超过个人年度限值的单次交易，以及完税价格超过5000元限值的单个不可分割商品，均按照一般贸易方式全额征税。</p><p><img src=\"https://wanmi-b2b.oss-cn-shanghai.aliyuncs.com/201907271625209678.jpg\" title=\"\" alt=\"undefined/\"/></p>', '<h3 class=\"title-text\" style=\"margin: 0px; padding: 0px; font-size: 18px; font-weight: 400;\">退税申请</h3><p>（1）出口货物的退税申请。出口货物在报关出口并在财务上做销售处理以及经过退税机关的退税鉴定的基础上，出口企业按退税期限自行计算填制《出口货物退（免）税申报表》，实行计算机管理的出口企业，可按照“出口退税申报系统”的要求生成《出口货物退税进货凭证申报表》、《出口货物退税申报明细表》、并填写《出口货物退税汇总申报表》，连同有关退税凭证及申报数据，向税务机关提出申请退税。</p><p><a class=\"lemma-anchor para-title\" style=\"color: rgb(19, 110, 194); position: absolute; top: -50px;\"></a><a class=\"lemma-anchor \" style=\"color: rgb(19, 110, 194); position: absolute; top: -50px;\"></a><a class=\"lemma-anchor \" style=\"color: rgb(19, 110, 194); position: absolute; top: -50px;\"></a><a class=\"lemma-anchor \" style=\"color: rgb(19, 110, 194); position: absolute; top: -50px;\"></a></p><h3 class=\"title-text\" style=\"margin: 0px; padding: 0px; font-size: 18px; font-weight: 400;\">货物审核</h3><p>（2）出口货物审核。分为外经贸部门稽核和基层税务机关审核。外经贸部门要根据本地区出口退税业务量的情况，设置出口退税稽核组或专职稽核员，负责监督检查出口企业执行退税政策规定的情况。基层税务机关审核，是在经贸部门审核的基础之上，对企业退税请的审核、核实工作。</p><p><a class=\"lemma-anchor para-title\" style=\"color: rgb(19, 110, 194); position: absolute; top: -50px;\"></a><a class=\"lemma-anchor \" style=\"color: rgb(19, 110, 194); position: absolute; top: -50px;\"></a><a class=\"lemma-anchor \" style=\"color: rgb(19, 110, 194); position: absolute; top: -50px;\"></a><a class=\"lemma-anchor \" style=\"color: rgb(19, 110, 194); position: absolute; top: -50px;\"></a></p><h3 class=\"title-text\" style=\"margin: 0px; padding: 0px; font-size: 18px; font-weight: 400;\">审批</h3><p>（3）出口退税的审批和税款的退付。地市以上的国家税务局具有出口退税审批权，其将出口企业申报表的内容录入出口退税计算机审核系统，与报关单、外汇核销单、专用税票等电子数据进行计算机交叉稽核，对稽核通过的数据，在国家下达的计划指标内，填开“收入退还书”，送达所在地金库，据以办理税款退库手续，将税款从当地金库的中央收入中退付给企业。</p><p><a class=\"lemma-anchor para-title\" style=\"color: rgb(19, 110, 194); position: absolute; top: -50px;\"></a><a class=\"lemma-anchor \" style=\"color: rgb(19, 110, 194); position: absolute; top: -50px;\"></a><a class=\"lemma-anchor \" style=\"color: rgb(19, 110, 194); position: absolute; top: -50px;\"></a></p><p><br/></p>', '<h3 class=\"title-text\" style=\"margin: 0px; padding: 0px; font-size: 18px; font-weight: 400;\">退税申请</h3><p>（1）出口货物的退税申请。出口货物在报关出口并在财务上做销售处理以及经过退税机关的退税鉴定的基础上，出口企业按退税期限自行计算填制《出口货物退（免）税申报表》，实行计算机管理的出口企业，可按照“出口退税申报系统”的要求生成《出口货物退税进货凭证申报表》、《出口货物退税申报明细表》、并填写《出口货物退税汇总申报表》，连同有关退税凭证及申报数据，向税务机关提出申请退税。</p><p><a class=\"lemma-anchor para-title\" style=\"color: rgb(19, 110, 194); position: absolute; top: -50px;\"></a><a class=\"lemma-anchor \" style=\"color: rgb(19, 110, 194); position: absolute; top: -50px;\"></a><a class=\"lemma-ancho